" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Pathogenesis of ovarian hyperstimulation syndrome",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?16/17/16660/contributors\">",
"     Authors",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?16/17/16660/contributors\">",
"     Vaclav Insler, MD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?16/17/16660/contributors\">",
"     Bruno Lunenfeld, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?16/17/16660/contributors\">",
"     Section Editors",
"    </a>",
"    <br/>",
