var title_f16_17_16667="Sickle trait alpha thalassemia";
var content_f16_17_16667=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F70184&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F70184&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Hematologic parameters in sickle cell trait-alpha thalassemia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Alpha globin genes",
"       </td>",
"       <td class=\"subtitle1\">",
"        Hemoglobin (g/dL)",
"       </td>",
"       <td class=\"subtitle1\">",
"        MCV (fL)",
"       </td>",
"       <td class=\"subtitle1\">",
"        Hemoglobin S (percent)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4",
"       </td>",
"       <td>",
"        13-15",
"       </td>",
"       <td>",
"        80-90",
"       </td>",
"       <td>",
"        35-45",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3",
"       </td>",
"       <td>",
"        13-14",
"       </td>",
"       <td>",
"        75-85",
"       </td>",
"       <td>",
"        30-35",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2",
"       </td>",
"       <td>",
"        12-13",
"       </td>",
"       <td>",
"        70-75",
"       </td>",
"       <td>",
"        25-30",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1",
"       </td>",
"       <td>",
"        7-10",
"       </td>",
"       <td>",
"        50-55",
"       </td>",
"       <td>",
"        17-25",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    This table shows the effect of the number of functioning alpha globin genes on hematologic parameters in patients with the combination of alpha thalassemia and sickle cell trait. (The absence of any functional alpha globin genes is incompatible with extrauterine life; the normal complement is four.)",
"    <div class=\"footnotes\">",
"     MCV: mean corpuscular volume.",
"    </div>",
"    <div class=\"reference\">",
"     Data from Steinberg, MH and Embury, SH. Blood 1986; 68:985.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
